import {Row, Col} from 'reactstrap';

const Fondo = styled.div`
    background-color: white;
    padding: 3rem;
`;

const EleccionContenido = () => {
    return (
        <Fondo>
            <Row>
                <Col xs={6}>

                </Col>
                <Col xs={6}>

                </Col>
                <Col xs={6}>

                </Col>
                <Col xs={6}>

                </Col>
                <Col xs={6}>

                </Col>
                
            </Row>
        </Fondo>
    );
}
 
export default EleccionContenido;
